    false,nt"url": null,nt"notes": "A total of 136 observations of Aleutian
    Canada geese were made on the SW, SE, and W sides of Chagulak Island on three different
    dates. The majority of the birds observed were either not banded or too far away
    to determine if they had leg bands. Most of the birds observed were either paired
    or in small flocks of ten or fewer birds which exhibited some territoriality. The
    number of potential duplicate observations made is unknown because of changes in
    weather, time and location. The birds were seen mainly in the mossy/willow habitat
    and upper edge of the Elynmus umbell habitat.",nt"license_title": "License
